script: |
  super -f text -I q3385.spq | sort > q3385.out

inputs:
  - name: q3385.spq
    data: |
      SELECT DISTINCT + col0 AS col0 FROM tab1 (FORMAT parquet) WHERE - + col2 * + ( col0 ) >= + col2 * col1 * - col1 + 79 * - col0 + - 11;
  - name: tab1

outputs:
  - name: q3385.out
    data: |
      51
      85
      91
